import { FcAbout } from "react-icons/fc";
import { createBrowserRouter, RouterProvider } from "react-router-dom";



const App=()=>{

  const router = createBrowserRouter([
    {
      path:"/",
      element:<Home/>
    },
    {
      path:"/about",
      element:<About/>
    } ,
    {
      path:"/servies",
      element:<Servies/>
    } ,
    {
      path:"/contact",
      element:<Contact/>
    }
  ]);
   return (
     <RouterProvider router={router} />
   )
};

export default App;
